import React from 'react';
import { List } from 'antd';

const Projects = ({ list }) => {
    return (
        <List
            rowKey="id"
            grid={{ gutter:24, xxl: 3, xl: 2, lg: 2, md: 2, sm: 2, xs: 2}}
            dataSource={list}
            renderItem={() => (
                <List.Item>
                    <Card
                        hoverable
                        cover={<img alt={item.title} src={item.cover} />}
                    ></Card>
                </List.Item>
            )}
        />
    );
};

export default Projects;
